import React, {Component} from 'react';

class TeamMembers extends Component {
    render(){
        return(
            <div>
                <label>Friend's Name</label>
                <input />
                <br />
                <label>Friend's Age</label>
                <input />
                <br />
                <button>Submit</button>
            </div>
        );
    }
}

export default TeamMembers;
